text:
⚠️🚨⚠️ CPI de arbitragem 24/04/2024, dps de ler a transcrição do audio d prova feita pelo senador C. Portinho, encontrei isso aqui. Analisem esse empate: Pênalti do Gabigol na trave, o árbitro do VAR que deu o pênalti aos 16 minutos: Rodrigo Guarizo Ferreira do Amaral; 

O árbitro de campo, Luiz Flávio, não tinha dado o "pênalti de 50%" (um pênalti duvidoso), quando o "cavalo selado passou" (jogador dividindo corpo dando a oportunidade da marcação), deu só depois do VAR o induzir;

Os acréscimos de ambos os tempos foram de + de 7 minutos, mas mesmo assim "os caras" (time do Flamengo) não venceu;

Pronto, ajudei a CPI, que trabalhem sério!

Cruzeiro jogou bem e dominou maior parte do jogo,mas o histórico de confrontos está assim:

Flamengo:30 vitórias e 95 gols;

Cruzeiro:28 vitórias e 84 gols;

Empates:22;

Total de jogos:80.
